import Head from 'next/head'
import React from 'react'
import Router from 'next/router'
import Header from '../components/header'

class Index extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      currentPath: ''
    }
  }
  componentDidMount() {
      
  }
  render() {
    return <div id='index'>
        <Header current='/'></Header>
        index
    </div>
  }
}
export default Index
